column8:
インクがいらないペン！フォーエバーピニンファリーナカンビアーノ 4EVER PININFARINA CAMBIANO ペン ボールペン インクレスインクが永遠にいらないペンとは？<br><br>
インクペンの精密さと、鉛筆のロマンティシズムを兼ね備えています。特製の「イーサーグラフ」という合金製のペン先が、紙との摩擦で酸化して筆跡を残す仕組みになっています。4.EVER は、インク無し、レフィル無し、鉛筆削り無し、トリック無しで、ほぼ永遠に書き続ける事ができます。<br><br>
商品カラー：シルバー、メタル、マットブラック<br><br>
サイズ：全長16センチ<br><br>
重量：約37グラム<br><br>
素材：ウォールナッツ/ メタル<br><br>
製造国：イタリア製<br><br></DIV>
